package BucleWhile;

public class FactorialW {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int num = 5;
        
        int resultado = 1;
        int i=2;
        while(i <= num) {
        	resultado = resultado*1;
        	i++;
        }
        System.out.print("El resultado es " + resultado);
	}

}
